return ['domain'=>NULL,'plural-forms'=>'nplurals=2; plural=(n > 1);','language'=>'fr_CA','pot-creation-date'=>'2025-09-04 10:01-0500','po-revision-date'=>'2025-09-04 10:01-0500','translation-revision-date'=>'2025-09-04 10:01-0500','project-id-version'=>'ICS Calendar','x-generator'=>'Poedit 3.7','messages'=>['%1$sYou are running ICS Calendar in a WordPress Playground implementation.%2$s Because ICS Calendar is intended to run on a web server, some features may be unavailable or may not function properly.'=>'%1$sVous exécutez ICS Calendar dans une implémentation de WordPress Playground%2$s Parce que ICS Calendar est conçu pour fonctionner sur un serveur web, certaines fonctionnalités peuvent être indisponibles ou ne pas fonctionner correctement.','%1$sYour site is currently using a UTC offset-based timezone setting.%2$s This can produce time display errors in the %3$s plugin in locations that observe Daylight Saving Time. Please %4$schange your timezone setting%5$s to the city nearest your location, in the same timezone, for proper time display. See our %6$sdocumentation%7$s for additional information on this issue.'=>'%1$sVotre site utilise actuellement un réglage de fuseau horaire basé sur le décalage UTC %2$s Cela peut produire des erreurs d\'affichage de l\'heure dans le plugin %3$s dans les endroits qui observent l\'heure d\'été. Veuillez %4$smodifier le réglage de votre fuseau horaire%5$s en choisissant la ville la plus proche de votre emplacement, dans le même fuseau horaire, pour un affichage correct de l\'heure. Consultez notre %6$sdocumentation%7$s pour plus d\'informations sur ce problème.','Utilities'=>'Utilities','Settings'=>'Paramètres','User Guide'=>'Guide de l’utilisateur','Support'=>'Support','Upgrade to PRO!'=>'Passez à PRO!','Show/hide all'=>'Afficher/masquer tout','ICS file could not be retrieved or was empty. Please verify URL is correct, and check your php.ini configuration to verify either cURL or allow_url_fopen is available. If you are using spaces to delimit multiple URLs, you may also wish to try using the pipe character instead. Affected URL:'=>'Le fichier ICS n’a pas pu être récupéré ou était vide. Veuillez vérifier que l’URL est correcte et vérifiez votre configuration php.ini pour vérifier que cURL ou allow_url_fopen est disponible. Si vous utilisez des espaces pour délimiter plusieurs URL, vous pouvez également essayer d’utiliser le caractère de tuyau à la place. URL affectée:','Hide past events'=>'Masquer les événement passés','Show past events'=>'Afficher les événements passés','Contact:'=>'Contact:','Resources:'=>'Ressources :','Click for more...'=>'Cliquez pour en savoir plus...','Save to your calendar'=>'Enregistrer dans votre calendrier','Cancelled'=>'Annulée','The legacy parser option is deprecated and will be removed in a future update.'=>'L\'option "legacy parser" est obsolète et sera supprimée lors d\'une prochaine mise à jour.','The "currentweek" shortcode attribute is deprecated. Please use view="week" in your shortcode instead.'=>'L’attribut shortcode « currentweek » est déconseillé. Veuillez utiliser view="week" dans votre shortcode à la place.','The "legendinline" shortcode attribute is deprecated. Please use legendstyle="inline" in your shortcode instead.'=>'L\'attribut de shortcode "legendinline" est obsolète. Veuillez utiliser legendstyle="inline" dans votre shortcode à la place.','Cleared %1$s %2$s transient(s).'=>'Effacement de %1$s %2$s transitoire(s).','No %1$s transients were found.'=>'Aucun transitoire %1$s n\'a été trouvé.','Your feed URL appears to contain HTTP Basic Authentication credentials. Try turning off the %1$s option under the %2$s tab above.'=>'L\'URL de votre flux semble contenir des informations d\'identification HTTP Basic Authentication. Essayez de désactiver l\'option %1$s sous l\'onglet %2$s ci-dessus.','Use legacy feed request method'=>'Utiliser l\'ancienne méthode de demande de flux','%1$sThis URL points to a file in your Media Library.%2$s While you should be able to use this URL in an %3$s shortcode, it will be a static snapshot of the calendar at the time the file was created, and will not reflect any future updates to the source calendar. Please see our %4$sUser Guide%5$s for instructions on obtaining your correct dynamic feed URL.'=>'%1$sCette URL pointe vers un fichier de votre bibliothèque multimédia%2$s Bien que vous puissiez utiliser cette URL dans un shortcode%3$s, il s\'agira d\'un instantané statique du calendrier au moment où le fichier a été créé, qui ne reflétera pas les mises à jour futures du calendrier source. Veuillez consulter notre %4$sGuide de l\'utilisateur%5$s pour obtenir des instructions sur l\'obtention de l\'URL de flux dynamique correcte.','Error: Could not resolve IP address for %1$s.'=>'Erreur : Impossible de résoudre l\'adresse IP de %1$s.','Resolved IP address for %1$s:'=>'Adresse IP résolue pour %1$s :','The text entered in the "Default shortcode" field is not a valid shortcode, and was not saved.'=>'Le texte saisi dans le champ "Shortcode par défaut" n\'est pas un shortcode valide et n\'a pas été enregistré.','%1$sSettings updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sMise à jour des paramètres%2$s Il se peut que vous deviez actualiser la page pour voir les changements.','calendar event'=>'événement de calendrier','The legacy feed request method is deprecated, and will be removed in an update in the near future. Please test your feeds with the legacy feed request method turned off.'=>'L\'ancienne méthode de demande de flux est obsolète et sera supprimée lors d\'une prochaine mise à jour. Veuillez tester vos flux en désactivant l\'ancienne méthode de demande de flux.','Map'=>'Carte','Recurring event'=>'Événement récurrent','Recurs every %1$s years'=>'Récurrence tous les %1$s ans','Recurs yearly'=>'Se reproduit chaque année','Recurs every %1$s months'=>'Récurrence tous les %1$s mois','Recurs monthly'=>'Se reproduit mensuellement','Recurs every %1$s weeks'=>'Réapparaît toutes les %1$s semaines','Recurs weekly'=>'Se reproduit chaque semaine','Recurs every %1$s days'=>'Réapparaît tous les %1$s jours','Recurs daily'=>'Se reproduit tous les jours','The "url" property in your %1$s shortcode appears to contain HTML tags; most likely your URL has been turned into a clickable link. Your calendar may not display properly as a result. Please remove the clickable link in the shortcode.'=>'La propriété "url" de votre shortcode %1$s semble contenir des balises HTML ; il est fort probable que votre URL ait été transformée en un lien cliquable. Votre calendrier peut donc ne pas s\'afficher correctement. Veuillez supprimer le lien cliquable dans le shortcode.','The r34ics_url_get_contents() function is no longer supported.'=>'La fonction r34ics_url_get_contents() n\'est plus supportée.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sVeuillez noter : %2$s %3$s la version 10.6 modifie les options par défaut de plusieurs paramètres de shortcodes. Dans un souci de cohérence, ces nouveaux paramètres par défaut ne sont %4$spas %5$s activés lors de la mise à jour d\'une version antérieure. Si vous souhaitez en savoir plus sur les modifications, veuillez lire notre %6$sarticle de blog%7$s, ou pour passer aux nouveaux paramètres par défaut, activez l\'option %8$s sur la page %9$s des paramètres%10$s.','Use new parameter defaults (v.10.6)'=>'Utiliser les nouveaux paramètres par défaut (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sVeuillez noter :%2$s %3$s la version 11.0 rationalise la façon dont les URL des flux ICS sont récupérés. Cette modification utilise une fonction standard intégrée de WordPress, et devrait donc être entièrement compatible avec toutes les installations existantes. Si vous rencontrez de nouveaux problèmes après la mise à jour vers la version 11 ou une version ultérieure, veuillez visiter les %4$sWordPress Support Forums%5$s pour obtenir de l\'aide.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sVeuillez noter :%2$s %3$s la version 11.5.14.2 introduit une nouvelle méthode, plus sûre, pour traiter les paramètres des calendriers lors du chargement via AJAX. Veuillez supprimer tous les plugins de mise en cache que vous utilisez, afin de vous assurer que vos calendriers se chargent correctement avec la nouvelle méthode.','Add %1$s'=>'Ajouter %1$s','Close'=>'Fermer','ICS Feed URL:'=>'URL du flux ICS :','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Assurez-vous que vous utilisez une URL %1$sd\'abonnement%2$s et non une URL %3$sd\'affichage web%4$s.%5$s (En entrant l\'URL directement dans votre navigateur web, vous devriez télécharger un fichier %6$s)','Calendar Title:'=>'Titre du calendrier :','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'Laissez vide pour utiliser le titre par défaut du calendrier. Saisissez %1$s pour ne pas utiliser le titre.','Calendar Description:'=>'Description du calendrier :','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'Laissez vide pour utiliser la description par défaut du calendrier. Saisissez %1$s pour ne pas utiliser la description.','View:'=>'Visualiser : ','month'=>'mois','list'=>'liste','week'=>'semaine','Count:'=>'Compte:','Format:'=>'Format:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'Laissez %1$s vide pour inclure tous les événements à venir. %2$s doit être une chaîne de format de date standard %3$sPHP%4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Afficher les descriptions des événements %1$s(changer en un nombre dans le shortcode inséré pour définir la limite de mots) %2$s','Show event locations %1$s(if available)%2$s'=>'Afficher les lieux des événements %1$s(si disponible) %2$s','Show event organizers %1$s(if available)%2$s'=>'Afficher les organisateurs de l\'événement %1$s(si disponible) %2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sNote :%2$s Des %3$soptions d\'affichage%4$s supplémentaires sont disponibles en modifiant manuellement le shortcode après insertion.','Insert %1$s'=>'Insérer %1$s','Do even more with %1$s!'=>'Faites-en plus avec %1$s !','Calendar Builder'=>'Générateur de calendrier','Configure all calendar settings with an easy visual interface... no need to manually type shortcodes.'=>'Configurez tous les paramètres du calendrier à l\'aide d\'une interface visuelle simple... pas besoin de taper manuellement des shortcodes.','Additional Views and Enhanced Features'=>'Vues supplémentaires et fonctionnalités améliorées','New ways to display your calendar including Full, Up Next, Masonry, Month with Sidebar, Widget, and more. Additional capabilities are added to the core Month, Basic, List and Week views.'=>'De nouvelles façons d\'afficher votre calendrier : complet, suivant, maçonnerie, mois avec barre latérale, widget, etc. Des fonctionnalités supplémentaires sont ajoutées aux vues de base Mois, Base, Liste et Semaine.','Customizer'=>'Personnalisateur','Easily modify your calendar color palettes, fonts, and more, site-wide.'=>'Modifiez facilement les palettes de couleurs de votre calendrier, les polices de caractères et bien plus encore, sur l\'ensemble du site.','ICS Events'=>'Événements ICS','%1$sNew!%2$s Turns %3$s into a full calendar system. Create and manage events directly in WordPress and even integrate them seamlessly with your existing feeds.'=>'%1$sNouveau !%2$s Transforme %3$s en un système de calendrier complet. Créez et gérez des événements directement dans WordPress et intégrez-les à vos flux existants.','Visit %1$s to learn more.'=>'Visitez %1$s pour en savoir plus.','Go PRO!'=>'Allez PRO!','Getting Started'=>'Pour Commencer','System Report'=>'Rapport système','Save Changes'=>'Enregistrer les modifications','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Merci d\'avoir installé %1$s. Avant de créer votre premier shortcode de calendrier, veuillez visiter votre page %2$sParamètres généraux%3$s et vérifier que les paramètres de langue, de fuseau horaire et de format de date/heure de votre site sont corrects. Consultez notre %4$sGuide de l\'utilisateur%5$s pour plus d\'informations.','Quick Start Guide'=>'Guide de démarrage rapide','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'Un %1$sGuide de l\'utilisateur%2$s complet est disponible sur notre site web. Vous trouverez ci-dessous quelques liens rapides vers des ressources clés de la documentation.','General:'=>'Généralités :','General WordPress Settings'=>'Paramètres généraux de WordPress','%1$s Settings'=>'%1$s Réglages','Working with Shortcodes:'=>'Travailler avec des codes courts :','Shortcode Overview'=>'Aperçu des shortcodes','Shortcode Builder'=>'Constructeur de shortcodes','Shortcode Parameters Reference'=>'Référence des paramètres des shortcodes','Advanced Topics:'=>'Sujets avancés :','FAQs and Tips'=>'FAQ et conseils','CSS Guide'=>'Guide CSS','Developer Resources'=>'Ressources pour les développeurs','GDPR'=>'RGPD','Appearance'=>'Apparence','Match calendar color palette to current Block Theme colors'=>'Faire correspondre la palette de couleurs du calendrier aux couleurs du thème actuel du bloc','beta'=>'Beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Remplace la palette de couleurs neutres par défaut %1$s par les couleurs les plus proches de la palette de couleurs actuelle de Site Editor Styles ou du fichier %2$s de votre thème. Les sélections de couleurs sont algorithmiques et certaines combinaisons peuvent ne pas passer les tests de contraste d\'accessibilité. Ce paramètre n\'a aucun effet si vous utilisez un thème "classique" qui n\'inclut pas de fichier %3$s.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar settings or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sCette fonctionnalité est actuellement en version bêta%2$s et peut nécessiter quelques ajustements dans les paramètres de votre calendrier ou de votre CSS pour un affichage optimal, en particulier si vous avez choisi un code couleur pour vos flux. La fonctionnalité est susceptible d\'être modifiée.','Dark mode'=>'Mode sombre','Inverts color palette (light colors on a dark background). %1$sNote:%2$s Dark mode also automatically applies style changes similar to the %3$s and %4$s shortcode parameters, so you do not need to include them in your shortcode.'=>'Inverse la palette de couleurs (couleurs claires sur fond sombre). %1$sNote :%2$s Le mode sombre applique aussi automatiquement des changements de style similaires aux paramètres %3$s et %4$s du shortcode, vous n\'avez donc pas besoin de les inclure dans votre shortcode.','Loading'=>'Chargement','Always use AJAX to render calendars (recommended)'=>'Utilisez toujours AJAX pour afficher les calendriers (recommandé)','When checked, all calendars will render via AJAX (asynchronously after the page loads). This is especially useful in conjunction with other caching plugins, or if your calendars contain a large number of events. Normally, calendar data is sent directly in the HTML of the initial page load unless AJAX has been specified in the shortcode.'=>'Si cette option est cochée, tous les calendriers seront affichés via AJAX (de manière asynchrone après le chargement de la page). Ceci est particulièrement utile en conjonction avec d\'autres plugins de mise en cache, ou si vos calendriers contiennent un grand nombre d\'événements. Normalement, les données du calendrier sont envoyées directement dans le code HTML du chargement initial de la page, sauf si AJAX a été spécifié dans le shortcode.','Increase memory limit when rendering calendars'=>'Augmenter la limite de mémoire lors de l\'affichage des calendriers','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Si votre calendrier ne se charge pas avec une erreur fatale "out of memory", essayez d\'augmenter la limite de mémoire. Un minimum de 512 Mo est recommandé. %1$s Notes : 1) Certains hébergeurs ne permettent pas aux applications d\'outrepasser les paramètres par défaut du serveur. 2) Il n\'est pas possible de définir cette option à un niveau inférieur à la limite de mémoire par défaut de votre serveur.','deprecated'=>'obsolète','If your site has stopped retrieving feeds after the version 11 update, turn on this option to use the legacy request method. This feature is deprecated and will be removed in an update in the near future.'=>'Si votre site a cessé de récupérer les flux après la mise à jour de la version 11, activez cette option pour utiliser l\'ancienne méthode de demande. Cette fonctionnalité est obsolète et sera supprimée lors d\'une prochaine mise à jour.','Default shortcode'=>'Shortcode par défaut','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Si votre site comprend un grand nombre de shortcodes de calendriers configurés de manière similaire, vous pouvez entrer ici un shortcode "de base" par défaut avec les paramètres qui doivent être les mêmes pour tous les calendriers. Les codes courts individuels sur le site peuvent alors inclure uniquement les paramètres qui sont uniques à ce calendrier, comme suit : %1$s Tout paramètre inclus dans le shortcode individuel remplacera ce qui est défini ici.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Autoriser l\'accès à ces noms d\'hôtes qui se résolvent en adresses IP réservées','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Si votre serveur de calendrier est hébergé sur le même serveur physique que votre site web, s\'il fait partie du même réseau local ou s\'il utilise une adresse IP %1$sréservée%2$s, saisissez son nom d\'hôte ici pour autoriser l\'accès. Pour plusieurs serveurs de calendrier, saisissez un nom d\'hôte par ligne. Voir %3$s la %4$s documentation%5$s pour plus d\'informations.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Saisissez un nom d\'hôte par ligne. Les noms d\'hôte correspondent au nom de domaine de base, et non à une URL complète. %1$s Par exemple, vous devez saisir %2$s et non %3$s.','Caching'=>'Caching','Transient (cache) expiration'=>'Expiration transitoire (cache)','seconds'=>'secondes','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour).'=>'Définit la durée pendant laquelle les données du flux du calendrier doivent être mises en cache sur le serveur (transitoires WordPress) avant d\'être rechargées. La valeur par défaut est 3600 (1 heure).','Miscellaneous'=>'Divers','Remove "Add ICS Calendar" button in Classic Editor'=>'Supprimer le bouton "Ajouter un calendrier ICS" dans l\'éditeur classique','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Par défaut, ICS Calendar ajoute un bouton "Ajouter ICS Calendar" à la barre d\'outils au-dessus de l\'éditeur WYSIWYG lorsque vous utilisez Classic Editor. Cochez cette case pour supprimer le bouton. N\'a aucun effet sur les sites utilisant l\'éditeur en bloc (Gutenberg).','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s version 10.6 a introduit de nouvelles valeurs par défaut pour plusieurs paramètres de shortcodes. Les nouvelles installations utilisent automatiquement les nouvelles valeurs par défaut, mais les installations mises à niveau continueront à utiliser les anciennes valeurs par défaut, à moins que cette case ne soit cochée. Pour en savoir plus sur ces changements, consultez %2$snotre blog%3$s.','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Notre guide d\'utilisation complet est disponible avec une traduction intégrale dans des dizaines de langues sur notre site web :','For assistance, please use our %1$ssupport request form%2$s.'=>'Pour obtenir de l\'aide, veuillez utiliser notre %1$sformulaire de demande d\'assistance%2$s.','When contacting support, please include the %1$sSystem Report%2$s from this page.'=>'Lorsque vous contactez le service d\'assistance, veuillez inclure le %1$sRapport du système%2$s de cette page.','Spread the word!'=>'Passez le mot !','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Si vous trouvez %1$s utile, vous pouvez nous aider à poursuivre notre croissance et notre développement en rédigeant un %2$s commentaire cinq étoiles%3$s. Nous vous en remercions','%1$s Data Cache'=>'%1$s Cache de données','Clear Cached Calendar Data'=>'Effacer les données de calendrier mises en cache','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'Cela effacera immédiatement toutes les données de calendrier mises en cache existantes (transitoires de purge), forçant WordPress à recharger tous les calendriers la prochaine fois qu’ils seront consultés. La mise en cache reprendra alors comme avant.','ICS Feed URL Tester'=>'Testeur d’URL d’alimentation ICS','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Si vous craignez que le plugin ne récupère pas correctement votre flux, vous pouvez tester l\'URL ici.','Enter feed URL...'=>'Entrez l’URL du flux...','Test URL'=>'Test URL','Results:'=>'Résultats :','%1$s received.'=>'%1$s reçu.','This appears to be a valid ICS feed URL.'=>'Il semble qu\'il s\'agisse d\'une URL de flux ICS valide.','This does not appear to be a valid ICS feed URL.'=>'Ceci ne semble pas être une URL de flux ICS valide.','Could not retrieve data from the requested URL.'=>'Impossible de récupérer des données à partir de l’URL demandée.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Une erreur inconnue s’est produite lors de la tentative de récupération de l’URL demandée.','Please copy the following text and include it in your message when emailing support.'=>'Veuillez copier le texte suivant et l’inclure dans votre message lorsque vous envoyez un courriel de support.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Veuillez également inclure le shortcode %1$s exactement comme vous l\'avez entré sur la page concernée.','For your site security please do NOT post the System Report in the support forums.'=>'Pour la sécurité de votre site, veuillez NE PAS publier le rapport du système dans les forums d\'assistance.','No events found.'=>'Aucun événement trouvé.','Previous Page'=>'Page précédente','Next Page'=>'Page suivante','All Day'=>'Toute la journée','Today'=>'Aujourd’hui','No events.'=>'Aucun événement.','No additional events this month.'=>'Pas d\'autres événements ce mois-ci.','Last week'=>'Semaine dernière','This week'=>'Cette semaine','Next week'=>'Semaine prochaine','ICS Calendar'=>'ICS Calendar','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'Transformez votre calendrier Google, Microsoft Office 365 ou Apple iCloud en une expérience WordPress intégrée de manière transparente, avec mise à jour automatique et sans maintenance.','Room 34 Creative Services, LLC'=>'Room 34 Creative Services, LLC']];
